    - uuslug
    - Member[models].Member[AutoTruncatedSlug]
  - - Django.db.models.Model~Subclass
    - uuslug
    - Member[models].Member[CoolSlugDifferentSeparator]
  - - Django.db.models.Model~Subclass
    - uuslug
    - Member[models].Member[CoolSlug]
  - - Django.db.models.Model~Subclass
    - uuslug
    - Member[models].Member[SmartTruncatedExactWordBoundarySlug]
  - - Django.db.models.Model~Subclass
    - uuslug
    - Member[models].Member[SmartTruncatedSlug]
  - - Django.db.models.Model~Subclass
    - uuslug
    - Member[models].Member[TruncatedSlugDifferentSeparator]
  - - Django.db.models.Model~Subclass
    - uuslug
    - Member[models].Member[TruncatedSlug]
